t<!-- this behavior is to be used to react to user behavior on the UI, snackbars MUST be disposed using user interraction -->\n\n\t\t<!--inside a container-->\n    <section #containerEl id="container" [style.position]="\'relative\'">\n        <template ngFor let-message [ngForOf]="infos | async">\n            <deja-snackbar *ngIf="message.gate" alignment="right" [outerContainerElement]="containerEl">\n                <deja-message-box type="primary" horizontal>\n\t\t\t\t\t\t{{message.content}}\n\t\t\t\t\t\t<template #actionsTemplate>\n                        <button md-mini-fab class="close" [color]="\'blank\'" (click)="message.gate = false">\n\t\t\t\t\t\t\t\t<md-icon>clear</md-icon>\n\t\t\t\t\t\t\t</button>\n\t\t\t\t\t\t</template>\n\t\t\t\t\t</deja-message-box>\n\t\t\t\t</deja-snackbar>\n\t\t\t</template>\n\t\t</section>\n\n\t\t<!--on the viewport-->\n    <template ngFor let-message [ngForOf]="successes | async">\n        <deja-snackbar *ngIf="message.gate" alignment="bottom left">\n            <deja-message-box type="success" horizontal>\n\t\t\t\t\t{{message.content}}\n\t\t\t\t\t<template #actionsTemplate>\n                    <button md-mini-fab class="close" [color]="\'blank\'" (click)="message.gate = false">\n\t\t\t\t\t\t\t<md-icon>clear</md-icon>\n\t\t\t\t\t\t</button>\n\t\t\t\t\t</template>\n\t\t\t\t</deja-message-box>\n\t\t\t</deja-snackbar>\n\t\t</template>\n\n    <template ngFor let-message [ngForOf]="warnings | async">\n        <deja-snackbar *ngIf="message.gate" alignment="bottom">\n            <deja-message-box type="warn" horizontal>\n\t\t\t\t\t{{message.content}}\n\t\t\t\t\t<template #actionsTemplate>\n                    <button md-mini-fab class="close" [color]="\'blank\'" (click)="message.gate = false">\n\t\t\t\t\t\t\t<md-icon>clear</md-icon>\n\t\t\t\t\t\t</button>\n\t\t\t\t\t</template>\n\t\t\t\t</deja-message-box>\n\t\t\t</deja-snackbar>\n\t\t</template>\n\n    <template ngFor let-message [ngForOf]="dangers | async">\n        <deja-snackbar *ngIf="message.gate" alignment="bottom right">\n            <deja-message-box type="danger" horizontal>\n\t\t\t\t\t{{message.content}}\n\t\t\t\t\t<template #actionsTemplate>\n                    <button md-mini-fab class="close" [color]="\'blank\'" (click)="message.gate = false">\n\t\t\t\t\t\t\t<md-icon>clear</md-icon>\n\t\t\t\t\t\t</button>\n\t\t\t\t\t</template>\n\t\t\t\t</deja-message-box>\n\t\t\t</deja-snackbar>\n\t\t</template>\n\n\t\t<section style="width: 400px; height: 4000px; border: red solid 1px;">\n\t\t\t<!-- server push like feed -->\n\t\t\t<!-- this behavior is to be used to push message to the client for example, snackbars MUST be displosed by themself -->\n\t\t\t<!-- to do so, define duration @Input and negate flag used for disposal using the onAnimationDone @Output -->\n        <template ngFor let-message [ngForOf]="messages | async">\n            <deja-snackbar *ngIf="message.gate" alignment="left" [duration]="5000" (onAnimationDone)="message.gate = false">\n                <deja-message-box type="primary" horizontal>\n\t\t\t\t\t\t{{message.content}}\n\t\t\t\t\t</deja-message-box>\n\t\t\t\t</deja-snackbar>\n\t\t\t</template>\n\t\t</section>\n</div>'},function(t,e){t.exports='<md-tab-group [selectedIndex]="1">\n    <!--<md-tab label="OVERVIEW">-->\n        <!--<md-card class="demo-card demo-basic">-->\n            <!--TODO-->\n        <!--</md-card>-->\n    <!--</md-tab>-->\n    <md-tab label="API REFERENCE">\n        <md-card class="demo-card demo-basic">\n            <deja-markdown [url]="\'https://raw.githubusercontent.com/DSI-HUG/dejajs-components/dev/src/component/splitter/readme.md\'"></deja-markdown>\n        </md-card>\n    </md-tab>\n    <md-tab label="EXAMPLES">\n\n\n        <md-card class="demo-card demo-basic">\n            <md-toolbar color="secondary">Horizontal splitter</md-toolbar>\n            <md-card-content>\n                <div class="container">\n                    <deja-splitter [direction]="\'horizontal\'">\n                   